evido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"43057","type":"Paragraph"},{"attributes":{"text":"Fator de Crescimetno = 110.1754"},"id":"43056","type":"Paragraph"},{"attributes":{"text":"\u00d3bitos Novos = 284.0000"},"id":"43053","type":"Paragraph"},{"attributes":{"axis_label":"Data de Notifica\u00e7\u00e3o (Ano de 2020)","formatter":{"id":"43081"},"major_label_orientation":1.2,"ticker":{"id":"42897"}},"id":"42870","type":"DatetimeAxis"},{"attributes":{"source":{"id":"42892"}},"id":"42896","type":"CDSView"},{"attributes":{"below":[{"id":"42917"}],"center":[{"id":"42920"},{"id":"42924"}],"left":[{"id":"42921"}],"plot_height":320,"renderers":[{"id":"42942"},{"id":"42949"}],"title":{"id":"42907"},"toolbar":{"id":"42932"},"x_range":{"id":"42909"},"x_scale":{"id":"42913"},"y_range":{"id":"42911"},"y_scale":{"id":"42915"}},"id":"42906","subtype":"Figure","type":"Plot"},{"attributes":{"text":"\u00d3bitos Acumulados = 8560.0000"},"id":"43052","type":"Paragraph"},{"attributes":{"callback":null,"formatters":{"$x":"datetime"},"tooltips":[["x","$x{%F}"],["y","@y"]]},"id":"42904","type":"HoverTool"},{"attributes":{"below":[{"id":"42870"}],"center":[{"id":"42873"},{"id":"42877"}],"left":[{"id":"42874"}],"plot_height":320,"renderers":[{"id":"42895"},{"id":"42902"}],"title":{"id":"42860"},"toolbar":{"id":"42885"},"x_range":{"id":"42862"},"x_scale":{"id":"42866"},"y_range":{"id":"42864"},"y_scale":{"id":"42868"}},"id":"42859","subtype":"Figure","type":"Plot"},{"attributes":{"axis_label":"Data de Notifica\u00e7\u00e3o (Ano de 2020)","formatter":{"id":"43102"},"major_label_orientation":1.2,"ticker":{"id":"42944"}},"id":"42917","type":"DatetimeAxis"},{"attributes":{"text":"Letalidade = 6.6253%"},"id":"43050","type":"Paragraph"},{"at             else document.addEventListener("DOMContentLoaded", fn);
          })();
        </script>
